import React, { useState, useEffect } from "react";
import { useLocation, useNavigate } from "react-router-dom";
import { MapContainer, TileLayer, Marker, Popup, Polyline } from "react-leaflet";
import "leaflet/dist/leaflet.css";

export default function RouteDetails() {
  const location = useLocation();
  const navigate = useNavigate();
  const itinerary = location.state?.itinerary || [];

  // If no itinerary passed, show message
  if (!itinerary.length) return <div>No itinerary found. Please generate a route first.</div>;

  // Format dates if needed
  const formattedItinerary = itinerary.map((spot) => ({
    ...spot,
    arrival: new Date(spot.arrival),
    departure: new Date(spot.departure),
  }));

  const [currentIndex, setCurrentIndex] = useState(0);
  const [currentSpot, setCurrentSpot] = useState(formattedItinerary[0]);
  const [startTime, setStartTime] = useState(new Date());

  useEffect(() => {
    setCurrentSpot(formattedItinerary[currentIndex]);
  }, [currentIndex]);

  const handleNext = () => {
    if (currentIndex + 1 < formattedItinerary.length) {
      setCurrentIndex(currentIndex + 1);
    } else {
      alert("You have reached the end of the itinerary!");
    }
  };

  const handleCancel = () => {
    if (window.confirm("Are you sure you want to cancel the route early?")) {
      navigate("/"); // go back to home
    }
  };

  const handleFinish = () => {
    alert("You have completed the route! Hope you enjoyed your trip.");
    navigate("/"); // go back to home
  };

  const routePositions = formattedItinerary.map((s) => [s.lat, s.lng]);

  return (
    <div style={{ display: "flex", flexDirection: "column", gap: 20, padding: 16 }}>
      <h2>Route Details</h2>
      <p>Start Time: {startTime.toLocaleTimeString()}</p>

      <div style={{ height: "400px", width: "100%" }}>
        <MapContainer center={[currentSpot.lat, currentSpot.lng]} zoom={13} style={{ height: "100%", width: "100%" }}>
          <TileLayer
            attribution='&copy; <a href="https://www.openstreetmap.org/">OSM contributors</a>'
            url="https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png"
          />
          {formattedItinerary.map((spot, i) => (
            <Marker key={i} position={[spot.lat, spot.lng]}>
              <Popup>
                <strong>{spot.name}</strong>
                <p>{spot.description}</p>
                <p>
                  Arrival: {spot.arrival.toLocaleTimeString()} <br />
                  Departure: {spot.departure.toLocaleTimeString()}
                </p>
              </Popup>
            </Marker>
          ))}
          <Polyline positions={routePositions} color="blue" />
        </MapContainer>
      </div>

      <div style={{ border: "1px solid #ccc", padding: 16, borderRadius: 8 }}>
        <h3>Current Stop: {currentSpot.name}</h3>
        <p>{currentSpot.description}</p>
        <p>
          Arrival: {currentSpot.arrival.toLocaleTimeString()} <br />
          Departure: {currentSpot.departure.toLocaleTimeString()}
        </p>
        <div style={{ display: "flex", gap: 10 }}>
          <button onClick={handleNext} disabled={currentIndex === formattedItinerary.length - 1}>
            Next Stop
          </button>
          <button onClick={handleCancel}>Cancel Route</button>
          {currentIndex === formattedItinerary.length - 1 && <button onClick={handleFinish}>Finish Route</button>}
        </div>
      </div>
    </div>
  );
}
